v1 = z_d_dot2 + kP*(vz-z_d_dot) + kI * (z - z_d)
u1 = (g-v1)*m/(sympy.cos(theta)*sympy.cos(phi))
phi_d = (m/u1)*(y_d_dot2 + kP*(y_d_dot-vy) + kI*(y_d - y))
theta_d = -(m/u1)*(x_d_dot2 + kP*(x_d_dot-vx) + kI*(x_d - x))
