f_bar = Matrix([[vx,
                 vy,
                 vz,
                 omega_phi,
                 omega_theta,
                 0,
                 (v1-g)*sympy.tan(theta),
                 (v1-g)*sympy.tan(phi)*sympy.sec(theta),
                 v1,
                 alpha_phi_d + kP*(omega_phi-omega_phi_d) + kI*(phi - phi_d),
                 alpha_theta_d + kP*(omega_theta-omega_theta_d) + kI*(theta - theta_d),
                 0,
                 x_d_dot,
                 y_d_dot,
                 x_d_dot2,
                 y_d_dot2,
                 x_d_dot3,
                 y_d_dot3,
                 x_d_dot4,
                 y_d_dot4,
                 x_d_dot5,
                 y_d_dot5,
                 x_d_dot6,
                 y_d_dot6,
                 x_d_dot7,
                 y_d_dot7,
                 z_d_dot,
                 z_d_dot2,
                 z_d_dot3,
                 z_d_dot4,
                 0,
                 0,
                 0,
                 0]]).transpose() #(q * p * (Ix - Iy)/Iz) = 0
for name, var in zip(["phi_d","theta_d"],[phi_d, theta_d]):
    Lf_1 = sympy.simplify(Matrix([[var.diff(v) for v in x_bar]]) * f_bar)
    print("omega_"+name,":",Lf_1)
    Lf_2 = sympy.simplify(Matrix([[Lf_1.diff(v) for v in x_bar]]) * f_bar)
    print("alpha_"+name,":",Lf_2)
    Lf_3 = sympy.simplify(Matrix([[Lf_2.diff(v) for v in x_bar]]) * f_bar)
    print("alpha_dot_"+name,":",Lf_3)

